import React from "react";
import Merlion from "./merlion.png";

const About = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <img src={Merlion} width="10%" />
    </div>
  );
};

export default About;
